import React from "react";
import "./login.css";
import image from "./photos/logo-ashoka.png";
import { Link } from "react-router-dom";

function login() {
  return (
    <div className="login">
      <Link to="/">
        <img className="login_logo" src={image} />
      </Link>
    </div>
  );
}

export default login;
